// App.js

import React, { Component } from 'react';

// Header
import Header from './component/Header';
import Sidebar from './component/Sidebar';

// Content
import Content from './content/home/Content';

class App extends Component {

  render() {
    return (
      <div>
        <Header />
        <Sidebar />
        <Content />
      </div>
    );
  }
}

export default App;
